var Common = {
	clickGoToUrl: function(){
		$('[data-go-to="href"]').on("click", function() {
			document.location = $(this).data('href');
            return false;
		});
	},
    aPreventDefault: function(){
        $('a.preventDefault').on('click',function(e){
            e.preventDefault();
        });
    },
    datePicker: function(){
        $('.datepicker-birthday').datepicker({
            defaultViewDate: { year: 1988, month: 1, day: 1 }
        });
    },
    showErrorForm: function(form, error, time){
        if(time == undefined){
            var time = 5000;
        }
        var html    = '<div class="alert alert-danger">';
        html += error;
        html += '</div>';
        form.find('.error').html(html);
        setTimeout(function(){
            form.find('.error > div').slideUp();
        }, time);
    },
    showSuccessForm: function(form, error, time){
        if(time == undefined){
            var time = 5000;
        }
        var html    = '<div class="alert alert-success">';
        html += error;
        html += '</div>';
        form.find('.error').html(html);
        setTimeout(function(){
            form.find('.error > div').slideUp();
        }, time);
    },
    select2: function(obj){
        if(obj == undefined){
            $(".select2").select2();
        }else{
            obj.select2();
        }
    }
    ,
    addTagsForInput: function(data, _tag){
        if(_tag == undefined){
            _tag = $('.tag-input');
        }
        if(data == undefined){
            data = [
                { tag: 'dog' },
                { tag: 'cat' },
                { tag: 'fish' },
                { tag: 'catfish' },
                { tag: 'dogfish' }
            ];
        }
        var tags = new Bloodhound({
            datumTokenizer: function(d) { return Bloodhound.tokenizers.whitespace(d.tag); },
            queryTokenizer: Bloodhound.tokenizers.whitespace,
            local: data
        });

        tags.initialize();
        /*// Set up an on-screen console for the demo
        var screenConsole = $('#console');

        // Write callback data to the screen when tags are added or removed in demo inputs
        var logCallbackDataToConsole = function(added, removed) {
            screenConsole.append('Tag Data: ' + (this.val() || null) + ', Added: ' + added + ', Removed: ' + removed + '\n');
        };*/


        // Create typeahead-enabled tag inputs
        _tag.tagInput({
            allowDuplicates: false,
            typeahead: true,
            typeaheadOptions: {
                highlight: true
            },
            typeaheadDatasetOptions: {
                displayKey: 'tag',
                source: tags.ttAdapter()
            }
            //onTagDataChanged: logCallbackDataToConsole
        });

    }

};

(function($) {
    $.fn.serializeFiles = function() {
        var obj = $(this);
        /* ADD FILE TO PARAM AJAX */
        var formData = new FormData();
        $.each($(obj).find("input[type='file']"), function(i, tag) {
            $.each($(tag)[0].files, function(i, file) {
                formData.append(tag.name, file);
            });
        });
        var params = $(obj).serializeArray();
        $.each(params, function (i, val) {
            formData.append(val.name, val.value);
        });
        return formData;
    };
})(jQuery);

var isMobile = {
    Android: function() {
        return navigator.userAgent.match(/Android/i);
    },
    BlackBerry: function() {
        return navigator.userAgent.match(/BlackBerry/i);
    },
    iOS: function() {
        return navigator.userAgent.match(/iPhone|iPad|iPod/i);
    },
    Opera: function() {
        return navigator.userAgent.match(/Opera Mini/i);
    },
    Windows: function() {
        return navigator.userAgent.match(/IEMobile/i);
    },
    any: function() {
        return (isMobile.Android() || isMobile.BlackBerry() || isMobile.iOS() || isMobile.Opera() || isMobile.Windows());
    }
};

var TNService = {
    getCallback: function (url, callback) {
        $.ajax({
            method: "GET",
            url: url
        }).done(function (data) {
            return callback(data);
        }).fail(function () {

        });
    },
    postCallback: function (url, params, callback, callback_error) {
        $.ajax({
            method: "POST",
            url: url,
            data: params
        }).done(function (data) {
            return callback(data);
        }).fail(function (e) {
            if (callback_error != undefined){
                return callback_error(true);
            }
        });
    }
};
