$(document).ready(function(){
    var idContent = $("#news-content");
    if(idContent.length){
        CKEDITOR.replace("news-content");
    }

    var idContentA = $("#article-content");
    if(idContentA.length){
        CKEDITOR.replace("article-content");
    }

    var pageCt = $("#page-content");
    if(pageCt.length){
        CKEDITOR.replace("page-content");
    }

    $(".openFinder").on('click', function () {
        var putId = $(this).attr('data-target');
        var finder = new CKFinder();
        if($(this).attr('data-folder') == 'Files' || $(this).attr('data-folder') == 'Images'){
            finder.resourceType = $(this).attr('data-folder');
        }
         finder.selectActionFunction = function (fileUrl) {
             $('body').find(putId).val(fileUrl);
         };
         finder.popup();
    });

    $('button.loading').on('click', function() {
        var $this = $(this);
        $this.button('loading');
        setTimeout(function() {
            $this.button('reset');
        }, 3000);
    });
    $('.iCheck').iCheck({
        checkboxClass: 'icheckbox_square-green'
    });

    Common.aPreventDefault();
});

